import React from 'react';
import './App.css';
import DataVisualization from './components/DataVisualization';
import { ThemeProvider } from '@mui/material/styles';
import theme from './theme/theme';
import CssBaseline from '@mui/material/CssBaseline';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import Paper from '@mui/material/Paper';
import MapComponent from './components/MapComponent';
import DemographicsPieChart from './components/DemographicsPieChart';
import logo from './logo.png'; // Ensure the path is correct

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <div
        className="hero-section"
        style={{
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
        }}
      >
        <img
          src={logo}
          alt="Logo"
          style={{ marginRight: '20px', height: '200px' }}
        />
        <div>
          <Typography variant="h2" style={{ color: '#333', textAlign: 'center' }}>
            Nest Quest
          </Typography>
          <Typography variant="h3" style={{ color: '#333', textAlign: 'center' }}>
            Explore. Discover. Decide.
          </Typography>
          <Typography
            variant="subtitle1"
            style={{ color: '#333', textAlign: 'left' }}
          >
            Dive into the world of locale data to make an informed decision with
            Nest Quest.
          </Typography>
        </div>
      </div>
      <Container maxWidth="lg">
        <Paper elevation={3} className="main-content">
          <div className="visualization-container">
            <DataVisualization />
          </div>
          <div className="map-container">
            <MapComponent />
          </div>
          <div className="demographics-chart-container">
            <DemographicsPieChart />
          </div>
        </Paper>
      </Container>
      <div className="footer">
        <Typography variant="body1">Nest Quest Â©2024</Typography>
      </div>
    </ThemeProvider>
  );
}

export default App;
